import logo from './logo.svg';
import './App.css';
import {Amazoncard} from "./cards"
import {Flipkartcards} from "./cards"

function App() {
      return (
        <div classname="main">
        <div classname="cards" style="">
          <Amazoncard/>
        </div>

      <div classname="flipkartbox">
      <div classname="cards">
        <Flipkartcards/>
      </div>
      </div>
    </div>
  );
}

export default App;
